import React, { Component } from 'react';
import './App.css';

class App extends Component {
  constructor(props){
    super(props);
    this.state = {
      data: 'Jordan Belfort',
      users: [],
    }
  }

  getData(){

    fetch('/users')
      .then(res => res.json())
      .then(users => this.setState({ users }));
  }

  componentDidMount(){
    this.getData();
  }

  render() {
    return(

      <div className="App">
        <h1></h1>


        {this.state.users.map(user =>
          <div key={user.id}>{user.username}</div>
        )}
      </div>
    )
  }
}

export default App;
